import "./ImageLinkForm.css"


const ImageLinkForm = ({onInputChange, onButtonSubmit, onReturn}) => {

    // const printNumber = (showFacesDetected) => {

    //     document.getElementById("test").innerHTML = showFacesDetected.target.value; 

    // }

    showFacesDetected = (boxes) => {
        var sum = 0;
        sum =+ (boxes);
        // console.log(sum);
        return String(sum);
    }

    return (

        <div>

        <div>
        <p className="f3">{"This Magic Brain will detect faces in your pictures. Try it out!"}</p>

        <div className="center">
            <div className="center pa4 br3 shadow-5 form">
        <input className="f4 pa2 w-70 center" type="text" onChange={onInputChange} onKeyPress={onReturn}/>
        <button className="w-30 grow f4 link ph3 pv2 dib white bg-orange" onClick={onButtonSubmit}>Detect Face</button>

            </div>

        </div>

    <p id="test" className="white f3"> {`${showFacesDetected()} face(s) detected in this image.`}</p>
    <script>{showFacesDetected()}</script>

    </div>


    </div>
    );
}

export default ImageLinkForm
